import React from 'react';
import Kensaku from './Kensaku';
import './Body.css';

export default function Body({ room }) {
const rooms = room.map((name, key) => <div key={key}>{name}{key}</div>)
    return (
        <div id="body">
            <Kensaku />
            <Kensaku />
            {rooms}
        </div>   
    )
}
